import React, { Component } from 'react'

export default class User extends Component {
  /**
   * 类组件的props是存储到类的实例对象中,
   *    可以直接通过实例对象访问
   *    this.props
   */
  render() {
    console.log(this.props)
    return (
      <ul>
        <li>姓名:{this.props.name}</li>
        <li>年龄:{this.props.age}</li>
        <li>性别:{this.props.gender}</li>
      </ul>
    )
  }
}
